webpackJsonp([0xfb8b9df363dc],{8113:function(t,e){t.exports={data:{post:{html:'<p>At the city festival in Buchholz, the city power utility had a rolling carpet on which one could "surf". Christopher of course had to try it out. He only wiped out twice, but no rug burns. Here are a couple of iPhone snapshots...</p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/3914904161" title="View \'IMG_0263\' on Flickr.com"><img src="http://farm3.static.flickr.com/2477/3914904161_074fc057a9.jpg" alt="IMG_0263" border="0" width="375" height="500" /></a></p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/3915682716" title="View \'IMG_0262\' on Flickr.com"><img src="http://farm4.static.flickr.com/3446/3915682716_e3b50a21f4.jpg" alt="IMG_0262" border="0" width="375" height="500" /></a></p>\n<p><a href="http://www.flickr.com/photos/51035717986@N01/3914909707" title="View \'IMG_0264\' on Flickr.com"><img src="http://farm4.static.flickr.com/3514/3914909707_7fab520f56.jpg" alt="IMG_0264" border="0" width="375" height="500" /></a></p>\n<p>Drinks were being served by the local Junge Union, the youth wing of the CDU party, which I mention only to annoy my German readers (most of whom are not pro-CDU :-).</p>',fields:{title:"Carpet Surfing",date:"13 Sep 2009",url:"https://papascott.de/2009-09-13-carpet-surfing/"}}},pathContext:{slug:"/2009-09-13-carpet-surfing/",prev:{fields:{title:"Exit Now!",date:"12 Sep 2009",slug:"/2009-09-12-exit-now/"}},next:{fields:{title:'And the crowd goes "Yeaahh!"',date:"18 Sep 2009",slug:"/2009-09-18-and-the-crowd-goes-yeaahh/"}}}}}});
